//------------------- Choose Direction Function -----------------//
int chooseDirection(int dirCode) { 
	
	// Up
	if (dirCode == 0x75) {
		return 1;
	}
	
	// Left
	else if (dirCode == 0x6B) {   
		return 2;
	}
	
	// Down
	else if (dirCode == 0x72) {
		return 3;
	}
	
	// Right
	else if (dirCode == 0x74) {
		return 0;
	}
	
	// No tile movement
	else {
		return 4;
	}
}